import {Grid} from '@mui/material';
import React from 'react';
import Details from './Details/Details';
const Todayweather=({data})=>
{
    return(
       <Grid container sx={{ padding: '3rem 0rem 0rem' }}> 
<Details data={data} />
       </Grid> 
    );
};

export default Todayweather;
